import {
    Grid, Container, Header, Item, Divider, Button,
  } from 'semantic-ui-react';
  import React from 'react';
  import Link from 'next/link';
  
  export default class AboutUsComp extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
      };
    }
  
    render() {
      return (
        <div>
          <div className="aboutComp">
            <div style={{
              position: 'absolute', top: 0, left: 0, bottom: 0, right: 0,
            }}
            >
              <div style={{
                position: 'relative', width: '100%', height: '100%', textAlign: 'center', display: 'flex', alignItems: 'center', justifyContent: 'center',
              }}
              >
                <div>
                  <p style={{fontSize: 50}}>Climb Our College Tree Now!</p>
                  <br />
                </div>
              </div>
            </div>
          </div>
          <div>
  
            <div
              className="margin"
              style={{
                position: 'relative', width: '100%', height: '100%', display: 'flex', justifyItems: 'center', justifyContent: 'center',
              }}
            >
              <Container text>
                <Grid divided>
                  <Grid.Row centered>
                    <p className="textOnImg3" style={{ fontWeight: 'bold' }}>ABOUT US</p>
                  </Grid.Row>
                  <Divider />
  
                  <Grid.Row>
                    <Grid.Column computer={16} tablet={8} mobile={16}>
                      <p>
                              Agnicart is India's most affordable ecommerce software provider. </p>
  
                              <p>Agnicart, a subsidiary of WML IT Solutions Pvt Ltd is a technology company located in Hyderabad, Telangana and is specialized in building scalable e-commerce platform enabling sellers across the globe to come online.</p>
  
                             <p> Our Vision is to enable you with technology tools to have the right digital footprint at affordable price and thereby accelerate your path to realize your dreams. </p>
  
                              <p>We understand that your time is best spent focusing on working with customers and drive sales. Our offerings are structured in such a way, so you get to focus on the business while we take care of your online setup, online store management, and digital marketing needs.</p>
                              {' '}
                          
                    </Grid.Column>
                  </Grid.Row>
                </Grid>
              </Container>
            </div>
          </div>
        </div>
      );
    }
  }
